import React from "react";

const Table = ({ tableMetaData, personData }) => {
  return (
    <div className="mt-5">
      <table className="table">
        <thead>
          <tr>
            {tableMetaData.map((x, i) => (
              <th key={i} scope="col">
                {x.headerTitle}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {personData.map((person) => (
            <tr key={person.id}>
              <td>{person.id}</td>
              <td>{person.name}</td>
              <td>{person.age}</td>
              <td>{person.gender}</td>
              <td>{person.dateOfBirth}</td>
              <td>{person.area}</td>
              <td>{person.email}</td>
              <td>{person.phonenumber}</td>
              <td>{person.occupation}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Table;
